let cursos_elegidos = [];
let carrera_elegida = "";

/* Preprocess */

function AddElement(){
    select = document.getElementById("listaCarrera");
    Object.keys(cursos).forEach((facultad, i) =>{
        var opt = document.createElement('option')
        opt.value = facultad;
        opt.text = facultad;
        select.appendChild(opt);
    });
}

function dia(j){
    let texto = "";
    switch(j){
        case 1:
            texto = "Lunes";
            break;
        case 2:
            texto = "Martes";
            break;
        case 3:
            texto = "Miercoles";
            break;
        case 4:
            texto = "Jueves";
            break;
        case 5:
            texto = "Viernes";
            break;
        case 6:
            texto = "Sabado";
            break;
        default:
            texto = " ";
            break;
    }
    return texto;
}

function crearCalendario(){
    const tabla = document.getElementById('tablaCalendario');
    // creando el encabezado
    // hora - lunes - martes - mircoles - jueves - viernes - sbado
    // en la primera columna: 7 - 8 - 9 - 10 - ... - 23
    const tablaBody = document.createElement('tbody');

    // Creando todas las celdas
    for (let i = 6; i <= 23; i++){
        // Creando una table row (fila)
        const row = document.createElement('tr');

        for (let j = 0; j < 7; j++){
            // creando un <td>
            const celda = document.createElement("td");
            let texto = `vaco`;
            let id = `${i}${dia(j)}`;
            //let texto = document.createTextNode(`celda en fila ${i}, columna ${j}`);
            if (i == 6){
                texto = dia(j);
                id = texto;
            }else{
                if (j == 0){
                    texto = `${i}:00`;
                    id = id + texto;
                }
            }


            //console.log(texto);
            celda.id = id;
            celda.innerHTML = texto;
            //celda.appendChild(texto);
            row.appendChild(celda)
        }
        tablaBody.appendChild(row);
    }
    tabla.appendChild(tablaBody);

}



function Init(){
    AddElement()
    crearCalendario()
}

Init()

/* Events*/
function elegir_carrera(){
    // limpiar
    cursos_elegidos = [];
    actualizar_cursos_elegidos();


    var valor = document.getElementById("listaCarrera").value;
    document.getElementById("nombreCarrera").innerHTML = valor;
    // Cargar datos 
    select = document.getElementById("cursosDisponibles");
    select.innerHTML = "";
    const cursos_carrera = cursos[valor];
    Object.keys(cursos_carrera).forEach((codigo, i) => {
        var opt = document.createElement('option');
        opt.id = codigo;
        opt.value = codigo;
        opt.text = cursos_carrera[codigo]["nombre"];
        select.appendChild(opt);

        //console.log(`${i+1}, ${codigo}, ${cursos_carrera[codigo]["nombre"]}`);
    });
}

// aadir en el calendario

function addCalendar(codCurso){
    // revisamos primeramente el nombre de la carrera
    nombre_carrera = document.getElementById('listaCarrera').value;
    const lu = cursos[nombre_carrera][codCurso]["LU"];
    const ma = cursos[nombre_carrera][codCurso]["MA"];
    const mi = cursos[nombre_carrera][codCurso]["MI"];
    const ju = cursos[nombre_carrera][codCurso]["JU"];
    const vi = cursos[nombre_carrera][codCurso]["VI"];
    const sa = cursos[nombre_carrera][codCurso]["SA"];
    console.log(lu);
    for (let i = 0; i < lu.length; i++){
        let hora = lu[i];
        let id = `${hora}Lunes`;
        document.getElementById(id).innerHTML =codCurso ;
    }

    for (let i = 0; i < ma.length; i++){
        let hora = ma[i];
        let id = `${hora}Martes`;
        document.getElementById(id).innerHTML =codCurso ;
    }

    for (let i = 0; i < mi.length; i++){
        let hora = mi[i];
        let id = `${hora}Miercoles`;
        document.getElementById(id).innerHTML =codCurso ;
    }

    for (let i = 0; i < ju.length; i++){
        let hora = ju[i];
        let id = `${hora}Jueves`;
        document.getElementById(id).innerHTML =codCurso ;
    }

    for (let i = 0; i < vi.length; i++){
        let hora = vi[i];
        let id = `${hora}Viernes`;
        document.getElementById(id).innerHTML =codCurso ;
    }

    for (let i = 0; i < sa.length; i++){
        let hora = sa[i];
        let id = `${hora}Sabado`;
        document.getElementById(id).innerHTML =codCurso ;
    }
}

function actualizar_cursos_elegidos(){
    select = document.getElementById('cursosElegidos');
    nombre_carrera = document.getElementById("listaCarrera").value;
    select.innerHTML = ""
    console.log(nombre_carrera);
    const cursos_carrera = cursos[nombre_carrera];
    for (let i = 0; i < cursos_elegidos.length; i++){
        const curso = document.createElement("ul");
        //console.log(cursos_carrera);
        curso.innerHTML = `${cursos_elegidos[i]} ${cursos_carrera[cursos_elegidos[i]]["nombre"]}`;
        select.appendChild(curso);
    }
}

function elegir_cursos(){
    const valor = document.getElementById("cursosDisponibles").value;
    console.log(`${valor}`);

    // revisamos si lo tenemos en la lista
    if (cursos_elegidos.indexOf(valor) == -1){
        // no est elegido
        cursos_elegidos.push(valor);
        console.log(cursos_elegidos);
        addCalendar(valor);

        // actualizando la lista
        actualizar_cursos_elegidos();
    }else{
        // si lo eligi
        console.log("Ese curso ya fue elegido");
    }
    
}


